css:
@-moz-document url-prefix("https://loult.family/")
{
  #chat
  {
    background-image: url("https://i.imgur.com/1nziToV.jpg")!important;
    background-position: center;
    background-repeat: no-repeat;
    image-rendering: pixelated;
    background-color: rgb(72, 39, 72);
    border-radius: 2em!important;
  }

  .msg,.log, .part, .kick,.info
  {
    background: rgb(0,0,0,0.7);
    margin: 2px 4em;
    border-radius: 10px!important;
  }
}
